import React from 'react';
import Button from './button';  // Use relative import
import { InputWithButton } from './input'; // Fixed component reference

export function Input({ type, placeholder }) {
  return (
    <input type={type} placeholder={placeholder} className="border p-2 rounded" />
  );
}

export function InputWith() {
  return (
    <div className="flex w-full max-w-sm items-center space-x-2">
      <Input type="email" placeholder="Email" />
      <Button type="submit">Subscribe</Button>
    </div>
  );
}

export default InputWith;
